Generalized Pregnancy Equation
Finally, even more generally, we can say that after $ x $ attempts and the more general $ () = p $ (i.e. using probability \(p\) instead of \(0.2\)):
\[
\begin{equation}
\begin{split}
\Pr(\text{Preg after x attempts}) &= 1 - \Pr(\text{Not Preg after x attempts}) \\
  &= 1 - (1-p)^x \\
\end{split}
\end{equation}
\]
